import React, { Component } from 'react';
const cellStyle = {
    width: '100px',
    height: '100px',
    border: '2px solid black'
  };
class Cell extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
        value: null,
      };
    }


  
    render() {
      return (
        <div style={cellStyle}>
          {this.props.value}
        </div>
      );
    }
  }
  export default Cell;
